import React from "react";
import './TodoSearch.css'

const onSearchValueChange = (event) => {
    console.log(event);
};

function TodoSearch(){
    return(
        <div className="header__search">
        <button className="header__search--img"></button>
        <input
          type="search"
          name="search"
          id="search"
          placeholder="Buscar"
          required
          minLength="4"
          onChange={onSearchValueChange}
        />
      </div>
    )
};

export {TodoSearch};
